results = []
for var_name, expected_value in expected.items():
    try:
        actual_value = globals()[var_name]
        if actual_value == expected_value:
            results.append(f"{var_name}: ✓ Correct ({actual_value})")
        else:
            results.append(f"{var_name}: ✗ Expected '{expected_value}', got '{actual_value}'")
    except NameError:
        results.append(f"{var_name}: ✗ Variable not defined")

for result in results:
    print(result)

# Final check
all_correct = all('✓' in result for result in results)
